import { memo } from "react";

function List({fruits}){
    return (
        <ul>
            {
                Object.values(fruits).length > 0 &&
                    Object.values(fruits).map((fruit,key)=>{
                        return (
                            <li key={key}>
                                <img 
                                    src={`${fruit.image}`}
                                    style={{width: 20, height: 20, borderRadius: 50}} 
                                />
                                {fruit.name}
                            </li>
                        )
                    })
            }
        </ul>

    )
}

export default (List);
